window.bookSummaryJSON = "<p>The<i> New York Times</i> and <i>USA Today</i> best-selling series&nbsp;&nbsp;</p> <p>They dive so humanity survives. Now they take to the sea.&nbsp;</p> <p>In the fourth installment of the award-winning and <i>USA Today</i> best-selling Hell Divers series, the <i>Sea Wolf </i>sets out to search for the Metal Islands. Leading the expedition is legendary Hell Diver Xavier Rodriguez. After enduring for a decade on the poisoned surface, his survival skills will be put to the test on the dangerous open seas.&nbsp;</p> <p>But storms, sea monsters, and the cannibalistic Cazadores aren't the only threat to X and his small crew. Their mission will uncover hard truths about the history of the war that left humankind stranded in the air for centuries. And the fate of those still living on the airships might very well rest on this fragile and perilous journey to find a new home.</p>"; 
